function parseArgs() {
    var argv = process.argv.slice(2);
    var argc = argv.length;

    if (argc !== 2) {
        console.log("Please only supply two arguments: the game name and the number to identify this nuzlocke with");
        return null;
    }

    var game = argv[0];
    var num;
    
    try {
        num = parseInt(argv[1], 10);
    } catch {
        console.log("Please only supply two arguments: the game name and the number to identify this nuzlocke with");
        return null;
    }

    return {"game": game, "num": num};
}

function main() {
    var gameInfo = parseArgs();

    if (gameInfo === null) {
        return;
    }

    fs.readdir("current/js", (err, files) => {
        if (err) {
            console.log(err);
            return;
        }

        var gameId;

        files.forEach((file) => {
            if (file !== "disableAll.js") {
                gameId = file;
            }
        });

        fs.copyFile("current/js/" + gameId, "past/js/" + gameId, (err) => {
            if (err) {
                console.log(err);
                return;
            }

            fs.copyFile("current/js/disableAll.js", "past/js/disableAll-" + gameId, (err) => {
                if (err) {
                    console.log(err);
                    return;
                }

                files.forEach((file) => {
                    fs.unlinkSync("current/js/" + file);
                });

                fs.writeFile("past/" + gameId.replace(".js", ".html"), indexDefaultText.replace("%%game%%", "js/" + gameId).replace("%%disableAll%%", "js/disableAll-" + gameId), {}, (err) => {
                    if (err) {
                        console.log(err);
                        return;
                    }
                    
                    fs.unlinkSync("current/index.html");

                    fs.writeFile("current/index.html", indexDefaultText.replace("%%game%%", "js/" + gameInfo.game + gameInfo.num.toString() + ".js").replace("%%disableAll%%", "js/disableAll.js"), {}, (err) => {
                        if (err) {
                            console.log(err);
                            return;
                        }

                        fs.writeFile("current/js/disableAll.js", disableDefaultText, {}, (err) => {
                            if (err) {
                                console.log(err);
                                return;
                            }

                            fs.writeFile("current/js/" + gameInfo.game + gameInfo.num.toString() + ".js", gameDefaultText, {}, (err) => {
                                if (err) {
                                    console.log(err);
                                    return;
                                }
                                
                                console.log("Setup is done.");
                            });
                        });
                    });
                });
            });
        });
    });
}

exports = {};
main();